description:
Category	Feature

Director	James Deen
Starring	Lia Lor, James Deen, Jennifer Dark, Amanda Tate

Critically renowned director and performer James Deen expands adult cinema with his ambitious '7 Sins' series. This installment follows the descent into depression of a young girl, played by Lia Lor. Deen and Lor, along with Amanda Tate and Jennifer Dark, inhabit a world of filth and depravity surrounded by beauty in a dark arousing tale of sloth!

